import React from "react";

const TableHead = props => {
  const { onSort } = props;
  return (
    <thead className="table-dark">
      <tr>
        <th className="fontifyr cur" onClick={() => onSort("title")}>
          Title
        </th>
        <th className="fontifyr cur" onClick={() => onSort("genre.name")}>
          Genre
        </th>
        <th className="fontifyr cur" onClick={() => onSort("numberInStock")}>
          Stock
        </th>
        <th className="fontifyr cur" onClick={() => onSort("dailyRentalRate")}>
          Rate
        </th>
        <th />
      </tr>
    </thead>
  );
};

export default TableHead;
